import React from "react";

const AdMaxSidebar = () => {
    return (
        <div style={{
            position: "fixed",
            top: "100px",
            right: "10px",
            width: "160px",
            height: "600px",
            backgroundColor: "#f4f4f4",
            border: "1px solid #ccc",
            display: "flex",
            justifyContent: "center",
            alignItems: "center"
        }}>
            <iframe
                src={`${window.location.origin}/ad-sidebar.html`}
                width="160"
                height="600"
                style={{ border: "none" }}
                title="AdMax Sidebar"
            ></iframe>
        </div>
    );
};

export default AdMaxSidebar;
